import ExpenseItem from "./ExpenseItem";
import './Expenses.css'

function Expenses(itemProps) {
    return (
        <div>
        <h2>Items list</h2>
        {Expenses.map((expense, index) => (
          <ExpenseItem
          key={index}
          title={expense.title}
          price={expense.price}
          date={expense.date}
          />
        ))}
      </div>
    )
}

export default Expenses
